import React from 'react';
import ContactItem from '../Components/ContactItem';
import phone from '../img/phone.svg';
import email from '../img/emailme.svg';
import location from '../img/location.svg';


function ContactPage(){
    return (
        <div className="ContactPage">
            <div className="map-sect">
                <div className="contact-sect">
                    <ContactItem icon={phone} text1={'+91 9081106815'} text2={'+0333 6822 6871'} title={'Phone'}/>
                    <ContactItem icon={email} text1={'+91 9081106815'} text2={'+0333 6822 6871'} title={'Email'}/>
                    <ContactItem icon={location} text1={'+91 9081106815'} text2={'+0333 6822 6871'} title={'Address'}/>
                </div>
            </div>
        </div>
    );
}

export default ContactPage;
